//media.alalam.ir/uploads/855x495/151004719051036300.jpg   ٠٩:٣٤ بتوقيت غرينتش تشديد الحصار السعودي على اليمن واتهام ايران بتهريب صواريخ الى اليمنيين والمشهد الامني في امريكا بعد مجزرة تكساس 
في ملفنا الاول نتناولُ تشديدَ السعودية الحصارَ على اليمن باغلاقِ المنافذِ البريةِ والبحريةِ والجوية وتَوعُّدِ ايران واتهامِها بتهريبِ الاسلحة والصواريخِ الى اليمنيين.. فكيفَ جاءَ الردُ الايراني؟؟؟ 
وفي ملفِنا الثاني، نطلُّ على المشهدِ الامني في امريكا، حيثُ ارتَكبَ مُسلَّحٌ مجرزةً في تكساس، لم تَصفْها السلطاتُ بالارهابية حتى الان. فلماذا لم تصفْها السلطاتُ بالارهابية، وماذا لو كانَ الجاني ذا ملامحٍ اسلاميةٍ عربية؟ تصنيف :
